import './App.css';
import React from 'react';
import ReactDOM from 'react-dom';


const root = ReactDOM.createRoot(
    document.getElementById('root')
);
const element = <h1>Hello, world</h1>;


function tick() {
  const element = (
      <div>
        <h1>Hello, world!</h1>
        <h2>It is {new Date().toLocaleTimeString()}.</h2>
      </div>
  );
  root.render(element);
}

function App() {


  return (
      tick()
  );

}


export default App;
